                <p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">Dekan</span><span lang="EN-US"> </span>"Nacionalnog znanstvenog medicinskog centra", doktor medicinskih znanosti, zaslužni radnik <span lang="EN-US">Srbije</span>, terapeut, nutricionist<br></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><br></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);">Radno iskustvo - 42 godine<o:p></o:p></p>
