						<div class="sadrzaj"><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);">Dijeta, vježbanje, tablete i liposukcija glavne su metode borbe protiv pretilosti danas, međutim, sudeći prema činjenici da broj pretilih ljudi i dalje raste, niti jedna od njih nije masovna i učinkovita. Sve se to promijenilo kada su uvedena prirodna pomagala za mršavljenje kao što je&nbsp;<span lang="EN-US">BURNCALL.</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US"><br></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><b>Što je <span lang="EN-US">BURNCALL</span>?</b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><br></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);">Ako vašem tijelu nedostaje vitamina A, jedete naranču, ako fosfor - ribu, vitamin C - crni ribiz.&nbsp;<b>Samo <span lang="EN-US">BURNCALL </span>sadrž<span lang="EN-US">i</span> elemente u tragovima koji izazivaju sagorijevanje masn<span lang="EN-US">oce </span>u ljudskom tijelu</b>.&nbsp;To su posebno&nbsp;super-antioksidanti, koji ne samo da sagorijevaju masnoće, već i normaliziraju funkcioniranje cijelog tijela.<o:p></o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p>&nbsp;</o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US"><b>BURNCALL</b> </span>je prirodni koncentrat.&nbsp;Jedna <span lang="EN-US">doza</span> sadrži 25 ekstrakata, zahvaljujući kojima se stopa sagorijevanja masti povećava 10 puta! Klinički je dokazano da <span lang="EN-US">BURNCALL</span> ubrzava metabolizam, obnavlja endokrini sustav, potiče regeneraciju tkiva i suzbija glad.&nbsp;Proizvod je apsolutno prirodan i aktivni je stimulator prirodnih procesa u ljudskom tijelu.&nbsp;Budući da se sagorijevanje masti događa brzim metabolizmom, stroga dijeta nije potrebna.&nbsp;Uravnotežena prehrana dovoljna je za održavanje metabolizma.&nbsp;Intenzivna tjelesna aktivnost u ovom slučaju nije potrebna.&nbsp;U krajnjem slučaju, dovoljno je jednostavno punjenje.<o:p></o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p>&nbsp;</o:p></p><p class="maki555_e4AaJE9jYG" style="margin: 5px 15px 15px; padding: 10px; color: black; line-height: 25px; font-size: 17px; background: none 0% 0% repeat scroll rgb(226, 226, 226); box-shadow: rgba(0, 0, 0, 0.75) 0px 0px 10px; font-family: Helvetica, Arial, sans-serif;"><span style="margin: 0px; padding: 0px; font-weight: 700;"><br class="Apple-interchange-newline">Glavne osobine BURNCALL:</span><br style="margin: 0px; padding: 0px;"><span style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">- Sagorijevanje masti</font></font><br style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">- Suzbijanje apetita</font></font><br style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">- Normalizacija hormonalne razine</font></font><br style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">- Podmlađivanje i čišćenje tijela</font></font><br style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">- Učinak toniziranja zbog sagorijevanja masti</font></font><br style="margin: 0px; padding: 0px;"></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p>&nbsp;</o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);">Zbog brzog metabolizma, ljudi koji uzimaju <span lang="EN-US">BURNCALL </span>&nbsp;mogu sagorjeti potkožnu masnoću u problematičnim područjima brzinom&nbsp;do 500 grama dnevno!&nbsp;<span lang="EN-US">BURNCALL </span>djelotvoran je čak i u slučajevima kada su hormonalni poremećaji uzrok prekomjerne težine.&nbsp;Ako ste skloni prekomjernoj težini - ovaj proizvod je za vas!<o:p></o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p>&nbsp;</o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);">U <span lang="EN-US">Bosni I Hercegovini</span> se ovaj dodatak pojavio relativno nedavno, ali već se nametnuo kao omiljeno sredstvo trenera i bodybuilding sportaša za&nbsp;brzo mršavljenje&nbsp;i&nbsp;održavanje niskog postotka tjelesne masti&nbsp;.<o:p></o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p></o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p>&nbsp;</o:p></p><div style="margin: 0px; padding: 0px; color: rgb(108, 110, 122); font-family: Helvetica, Arial, sans-serif; font-size: 18px; text-align: center;"><img alt="" src="http://landingpagecopy.ru/demo/ketoslim/0105/src/img1.jpg" style="margin: 0px; padding: 0px; max-width: 600px; width: 600px;"><br style="margin: 0px; padding: 0px;"><p style="margin: 15px; color: black; line-height: 25px; font-weight: bold;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">Rezultat nakon 30 dana uzimanja BURNCALL</font></p></div><div style="margin: 0px; padding: 0px; color: rgb(108, 110, 122); font-family: Helvetica, Arial, sans-serif; font-size: 18px; text-align: center;"><img alt="" src="http://landingpagecopy.ru/demo/ketoslim/0105/src/img2.jpg" style="margin: 0px; padding: 0px; max-width: 600px; width: 600px;"><br style="margin: 0px; padding: 0px;"><p style="margin: 15px; color: black; line-height: 25px; font-weight: bold;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">Rezultat nakon 45 dana uzimanja BURNCALL</font></p></div><div style="margin: 0px; padding: 0px; color: rgb(108, 110, 122); font-family: Helvetica, Arial, sans-serif; font-size: 18px; text-align: center;"><img alt="" src="http://landingpagecopy.ru/demo/ketoslim/0105/src/img3.jpg" style="margin: 0px; padding: 0px; max-width: 600px; width: 600px;"><br style="margin: 0px; padding: 0px;"><p style="margin: 15px; color: black; line-height: 25px; font-weight: bold;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">Rezultat nakon 33 dana uzimanja BURNCALL</font></p></div><div style="margin: 0px; padding: 0px; color: rgb(108, 110, 122); font-family: Helvetica, Arial, sans-serif; font-size: 18px; text-align: center;"><img alt="" src="http://landingpagecopy.ru/demo/ketoslim/0105/src/img4.jpg" style="margin: 0px; padding: 0px; max-width: 600px; width: 600px;"></div><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><br></p><p class="swetlana40_GWDvkz8Tqs" style="margin-top: 15px; margin-right: 15px; margin-left: 15px; color: black; line-height: 25px; font-weight: bold; font-size: 22px; font-family: Helvetica, Arial, sans-serif;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">Komentari istraživača:</font></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><br style="margin: 0px; padding: 0px; color: rgb(108, 110, 122); font-family: Helvetica, Arial, sans-serif; font-size: 18px;"></p><div style="margin: 0px; padding: 10px; color: rgb(108, 110, 122); font-family: Helvetica, Arial, sans-serif; font-size: 18px; background-color: rgb(226, 226, 226);"><div class="gelat_Bb6MhOHv" style="margin: 0px; padding: 0px 30px 10px 0px; float: left; font-size: 12px; font-style: italic; color: rgb(161, 161, 168);"><img src="http://landingpagecopy.ru/demo/ketoslim/0105/src/doc-ukr2-1.jpg" width="300px" style="margin: 0px; padding: 0px;"></div><p style="margin: 15px; color: black; line-height: 25px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Aleksej Nikic,</span><br style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">nutricionist-endokrinolog;</font><br style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">Radno iskustvo - 27 godina</font></p><div style="margin: 0px; padding: 0px; clear: both;"></div></div><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);">"Najvažnije u mršavljenju nije naštetiti svom tijelu. Nažalost, većina popularnih načina mršavljenja ne može se time pohvaliti. Ne možete stalno sjediti na dijeti i ne mogu je svi izdržati. Ne postigavši njihov cilj, ljudi se okreću tabletama, od kojih velika većina samo ugnjetava tijelo, izazivajući poremećaje u radu hormona, imunološkog sustava i jetre.&nbsp;<b>Gubitak kilograma trebao bi biti prirodan, a ne remetiti unutarnje procese u tijelu.</b>&nbsp;<o:p></o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p><b>&nbsp;</b></o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><b><span lang="EN-US">BURNCALL</span><span lang="EN-US"> </span>jedini <span lang="EN-US">je </span>alat koji ispunjava ove zadatke.&nbsp;</b>Aktivni elementi u tragovima <span lang="EN-US">BURNCALL </span>izazivaju ubrzanje metabolizma i sagorijevanje masne mase, a njihov koncentrat u <span lang="EN-US">jednoj dozi </span><span lang="EN-US">&nbsp;</span>pojačava te procese najmanje 10 puta.&nbsp;Uvjeren sam da je ovaj lijek danas najbolja stvar u modernoj dijetetici.&nbsp;To je također dokazani proizvod kojem možete u potpunosti vjerovati. "<o:p></o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p>&nbsp;</o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p></o:p></p><div style="margin: 0px; padding: 10px; color: rgb(108, 110, 122); font-family: Helvetica, Arial, sans-serif; font-size: 18px; background-color: rgb(226, 226, 226);"><div class="gelat_Bb6MhOHv" style="margin: 0px; padding: 0px 30px 10px 0px; float: left; font-size: 12px; font-style: italic; color: rgb(161, 161, 168);"><br class="Apple-interchange-newline"><img src="http://landingpagecopy.ru/demo/ketoslim/0105/src/doc-ukr3-1.jpg" width="300px" style="margin: 0px; padding: 0px;"></div><p style="margin: 15px; color: black; line-height: 25px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Olga Vladimirovic,</span><br style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">nutricionist-endokrinolog,</font><br style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">Radno iskustvo - 18 godina</font></p><div style="margin: 0px; padding: 0px; clear: both;"></div></div><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p>&nbsp;</o:p><span style="font-size: 12pt;">"Žene mi često dolaze doslovno sa suzama u očima. Sve su pokušale, ali rezultat ili nije, ili se težina neprestano vraća. Prethodno sam im savjetovao da se smire, prikupe i počnu ispočetka.</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p></o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p>&nbsp;</o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);">Danas postoji bolji izlaz -&nbsp;<span lang="EN-US"><b>BURNCALL</b></span>. Samo ga uzmite kao dodatak prehrani i na potpuno prirodan način izgubite do <span lang="EN-US">2</span>5 kg mjesečno. Ovo je potpuno prirodan lijek koji je pogodan za sve, bez obzira na spol, dob ili zdravstveno stanje.&nbsp;Gubitak kilograma postiže se samo sagorijevanjem masne mase, a ne dehidracijom.&nbsp;<o:p></o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p>&nbsp;</o:p></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);">Na problematičnim područjima učinak postaje primjetan nakon <span lang="EN-US">deset</span> dana.&nbsp;<span lang="EN-US">BURNCALL </span>već se dugo koristi u svijetu dijetetike, a sada stječe popularnost u <span lang="EN-US">BiH</span>.&nbsp;Osobno ga preporučujem svim svojim pacijentima i još nisam čuo niti jednu negativnu kritiku ili prigovor. "</p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><br></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p></o:p></p><p class="maki555_e4AaJE9jYG" style="margin: 5px 15px 15px; padding: 10px; color: black; text-align: center; line-height: 20px; font-size: 15px; background: none 0% 0% repeat scroll rgb(226, 226, 226); box-shadow: rgba(0, 0, 0, 0.75) 0px 0px 10px; font-family: Helvetica, Arial, sans-serif;"><img src="data:image/png;base64," data-filename="caj_burncall_trans.png" style="width: 1066px;"><br></p><p style="margin: 15px; color: black; line-height: 25px; font-family: Helvetica, Arial, sans-serif; font-size: 25px; font-weight: 700;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><br></font></p><p style="margin: 15px; color: black; line-height: 25px; font-family: Helvetica, Arial, sans-serif; font-size: 25px; font-weight: 700;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">Istraživanje</font></p><p style="margin: 15px; color: black; line-height: 25px; font-family: Helvetica, Arial, sans-serif; font-size: 18px;"><span style="margin: 0px; padding: 0px; font-weight: 700;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">Rezultati istraživanja&nbsp;</font></font><font style="margin: 0px; padding: 0px; color: rgb(22, 151, 206); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">BURNCALL</font></font><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">&nbsp;na Istraživačkom institutu za dijetetiku i prehranu Federacije:</font></font></span></p><p style="margin: 15px; color: black; line-height: 25px; font-family: Helvetica, Arial, sans-serif; font-size: 18px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">Skupina ispitanika (100 ljudi), koji su imali prekomjernu tjelesnu težinu, uzimali su BURNCALL svakodnevno kao dodatak prehrani mjesec dana bez promjene uobičajene prehrane.&nbsp;</font><font style="margin: 0px; padding: 0px; vertical-align: inherit;">Tijekom studije dobiveni su sljedeći rezultati:</font></font></p><p style="margin: 15px; color: black; line-height: 25px; font-family: Helvetica, Arial, sans-serif; font-size: 18px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><br></font></font></p><p style="margin: 15px; color: black; line-height: 25px; font-family: Helvetica, Arial, sans-serif; font-size: 18px;"></p><div style="margin: 0px; padding: 0px; color: rgb(108, 110, 122); font-family: Helvetica, Arial, sans-serif; font-size: 18px; clear: both;"></div><p class="maki555_e4AaJE9jYG" style="margin: 5px 15px 15px; padding: 10px; color: black; line-height: 20px; font-size: 15px; background: none 0% 0% repeat scroll rgb(226, 226, 226); box-shadow: rgba(0, 0, 0, 0.75) 0px 0px 10px; font-family: Helvetica, Arial, sans-serif;"><span style="margin: 0px; padding: 0px;"><span style="margin: 0px; padding: 0px; font-weight: 700;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">1.Gubitak masne mase od 12 do 15 kg.</font></font><br style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">- kod mršavljenja u 15 kg - 95%</font></font><br style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">- kod&nbsp;</font><font style="margin: 0px; padding: 0px; vertical-align: inherit;">mršavljenja u 12 kg&nbsp;</font><font style="margin: 0px; padding: 0px; vertical-align: inherit;">- 100%.</font></font><br style="margin: 0px; padding: 0px;"><span style="margin: 0px; padding: 0px; font-size: 12px; line-height: 14px; display: inline-block;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">* Gubitak u ovom slučaju znači rješavanje masne mase i njezino odsustvo tijekom 1 mjeseca.</font></font></span><br style="margin: 0px; padding: 0px;"><br style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">2. Primjetno poboljšanje metabolizma.</font></font><br style="margin: 0px; padding: 0px;"><br style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">3. Poboljšanje tonusa i tjelesne aktivnosti.</font></font><br style="margin: 0px; padding: 0px;"><br style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">4. Poboljšanje jetre i endokrinog sustava.</font></font><br style="margin: 0px; padding: 0px;"><br style="margin: 0px; padding: 0px;"><span style="margin: 0px; padding: 0px;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">Dokazano je da BURNCALL snažno utječe na jačanje metabolizma i sagorijevanje masti.&nbsp;</font></font></span><font style="margin: 0px; padding: 0px; vertical-align: inherit;"><font style="margin: 0px; padding: 0px; vertical-align: inherit;">Primijenjen je za osobe prekomjerne tjelesne težine, osobe s oštećenim metabolizmom i dijabetes melitusom.</font></font></span></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><o:p>&nbsp;</o:p></p></div>
